import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import NotFound from "./Podstrony/NotFound";
import About from "./Podstrony/About";
import Contact from "./Podstrony/Contact"; // Import strony kontaktowej
import NotesList from "./Components/Note/notesList"; // Import listy notatek
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <div className="container">
        <Routes>
          {}
          <Route
            path="/"
            element={
              <>
                <h1 className="page-title">Strona Główna</h1>
                <NotesList />
              </>
            }
          />
          {/* Strona kontaktowa */}
          <Route path="/notes" element={<Contact />} />
          {/* Strona o aplikacji */}
          <Route path="/about" element={<About />} />
          {/* Strona błędu 404 */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </div>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
